import time

class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next
class Solution:
    def __init__(self):
        self.head = None
        self.length = 0
    def addLast(self, val):

        self.addAtIndex(val,self.length)

    def addAtIndex(self,val,index):
        n = ListNode(val)
        if index<0 or index>self.length:
            print("sorry index is invalid!!")
        else:



            if index==0:
                n.next = self.head
                self.head = n
                self.length+=1
            elif index==self.length:
                curr = self.head
                while(curr.next!=None):
                    curr = curr.next
                curr.next=n
                self.length+=1
            else:
                ctr = 0
                curr = self.head
                while(ctr!=index-1):
                    curr = curr.next
                    ctr+=1
                n.next= curr.next
                curr.next = n
                self.length+=1

    def show(self):

        curr = self.head
        while (curr.next != None):
            print(curr.val,"-->",end="",sep="")

            curr = curr.next
        print(curr.val)

    def do(self):
        return self.nextLargerNodes(self.head)
    def nextLargerNodes(self, head: ListNode):
        curr = head
        #new = []
        dic = dict()
        try:
            while curr.next != None:
                upcoming = curr.next
                max = curr.val
                flag = False
                while upcoming.next != None:
                    if upcoming.val > max and flag == False:
                        max = upcoming.val
                        flag = True
                    upcoming = upcoming.next
                if upcoming.val > max and flag == False:
                    max = upcoming.val

                if max == curr.val:
                    ############################### no greater value
                    #new.append(0)
                    dic[curr]=0
                else:
                    ######################### found greater value
                    #new.append(max)
                    dic[curr]=max
                ########################### add 0 only
                curr = curr.next
            dic[curr]=0
            #new.append(0)
            return dic.values()
        except:
            return []

